import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import "./index.css";
import data from "./data";
import Heading from "./Heading";
// import App from "./App";
// import { Add, Divide, Mod, Mul, Sub } from "./Clc";

function ncard(val) {
  return (
    <Card  key={val/id}imgsrc={val.imgsrc} title={val.title} sn={val.sn} link={val.link} />
  );
}

ReactDOM.render(
  <>
    <Heading/>
    <div className="container">
      <div className="cards d-flex justify-content-around"> {data.map(ncard)}</div>
    </div>
  </>,
  document.getElementById("root")
);
